t=0
delays = {}
melted = 0
mp=0
function _init()
	music(0)
	load_font()
	poke(24408,129)
	load_sprites(logo)
	gen_delays()
end

function load_sprites(img)
	for i=1,16384,2 do
		poke((i-1)/2,"0x"..sub(img,i,i+1))
	end
end

function _update()
	t=t+1
	if(t==236)then
		load_sprites(demo_logo)
		gen_delays()
		melted=0
	end
	if((t+1)%48==0)then mp+=1 end
end

function _draw()
	cls(0)
	intro()
