	//print(stat(9),0,20,0)
	//print(t,0,0,3)
	//print(melted,0,20,3)
	print(mp,0,0,7)
	print(t,0,10,7)
end

function intro()
	if(t>91 and t<=151)then
		spr(0,0,0,16,16)
		if(t<116)then fade_in(91) end
	elseif(t>151 and t<=235)then
		fillp()
		melting()
		spr(0,0,0,16,16)
	elseif(t>235 and t<=295)then
		spr(0,0,0,16,16)
		if(t<260)then fade_in(235) end
	elseif(t>295 and t<=379)then
		fillp()
		melting()
		spr(0,0,0,16,16)
	end
end

function fade_out()
	fillp(fade[flr((t-220)*0.5)+1]) 
		rectfill(0,0,127,127,0)
end

function fade_in(m)
	fillp(fade[6-ceil((t-m)/5)]) 
	rectfill(0,0,127,127,0)
	//printh(6-ceil((t-m)/5),"fade.txt")
end

fade={
	0xffff.8,
	0xa5a5.8,
	0x0a0a.8,
	0x2080.8,
	0x0200.8,
	0x0000.8,
}

function melting()
	if (melted>=60) then memcpy(128,0,8128)
	else
		for i = 0, 127, 2 do
			if delays[i/2+1]==0 then
				for j = 128, 0, -1 do
					poke(i+(j-1)*64, @(i+(j-2)*64))
					poke(i+1+(j-1)*64, @(i+1+(j-2)*64))
				end
			else
				delays[i/2+1]+=1
				if(delays[i/2+1]==0) then melted+=1 end
			end
		end
	end
end

function gen_delays()
	delays={}
	for i = 1, 64, 1 do
		delay=flr(rnd(30)) - 29
		if(delay==0)then melted+=1 end
		add(delays, delay)
	end
end

